public final void update(byte[] buff, int pos, int len)
	{
		int space = 64 - ((int) (count & 0x3f));

		count += len;

		while (len > 0)
		{
			if (len < space)
			{
				System.arraycopy(buff, pos, block, 64 - space, len);
				break;
			}

			if (space == 64)
			{
				transform(buff, pos);
			}
			else
			{
				System.arraycopy(buff, pos, block, 64 - space, space);
				transform(block, 0);
			}

			pos += space;
			len -= space;
			space = 64;
		}
	}

